  } else {
    <Login />;
  }
}
function App() {
  return (
    <>
      <>
        <div className="container">
          <form className="form">
            <input className="inputField" type="text" placeholder="UserName" />
            <input
              className="inputField"
              type="passwordf"
              placeholder="password"
            />
            <button type="submit">Login</button>
          </form>
        </div>
      </>
    </>
  );
}
export default App;
